&gt; The predacon comander sat down and looking to Cyclonus &quot;Cyclonus, do you
&gt; have any news about Jhiaxus and co, that rat of Perceptor and the
&gt; maximals?&quot;

Cyclonus shook his head slightly, &quot;Ever since that last explosion
Jhiaxus and Scorponok have gone quiet. There has been no attempt by
them to take over, in fact there has been no communication from them.&quot;
Cyclonus frowned as he continued, &quot;From my last scan it would seem
that Perceptor has left with the Maximals.&quot;

Cyclonus looked around the room, nodding in satisfaction as he looked
at it, it was almost as if he were looking at it for the first time,
or at least for the first time in some time. He looked back at Hydras,
&quot;I have been working to reopen some of the Predacon stasis pods that
had held damaged soldiers, as well as there have been several that
have returned since you were sleeping.&quot; Cyclonus gestured at the room,
&quot;Fractyl has been instrumental in repairing much of the damage to the
base.&quot;

Cyclonus looked troubled, &quot;But Scourge is still missing. I have not
heard from him either since I sent him after the Maximals.&quot;

